import React, {useState, useEffect} from 'react';

const Pokemon = () => {

    const baseURL = 'https://pokeapi.co/api/v2/';

    useEffect(() => {
        console.log("Component Mounted")
        axios.get(baseURL + 'pokemon/ditto')
        .then(res => {
            console.log(res.data.name);
        })
    }, [])

    return (
        <div>
            <h1>Pokemon List</h1>
        </div>
    )
}
export default Pokemon;
